campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 717, \"fields\": {\"priority\": 1, \"description\": \"January 2021: The CDU is in a state of upheaval following Merkel's announcement of retirement. <br>Annegret Kramp-Karrenbauer was her handpicked successor, but after she faltered, the party is looking for a new leader. After passing up a bid in the former contest in 2018, you feel like now is the time to strike - how do you want to convince the delegates to vote for you instead of Friedrich Merz or Norbert Röttgen?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 718, \"fields\": {\"priority\": 1, \"description\": \"Congratulations, you are now the 12th party leader of the Christian Democratic Union! You are not the official chancellor candidate of the Union of CDU and CSU yet, but hopefully, that will just be a formality. In your acceptance speech at the convention, what will be your emphasis?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 719, \"fields\": {\"priority\": 1, \"description\": \"March 2021: COVID-19 has shaped the lives of people in Germany and across the world for the past years. Now that the winter is over, a lot of people are demanding an end to the harsh lockdowns. As Minister-President of North Rhine-Westphalia, you could chart a new course for your government. What is your stance on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 720, \"fields\": {\"priority\": 1, \"description\": \"You’ve been invited to a talk show to talk about tax policy and the “Black Zero”, which mandates a balanced budget. The left and left-of-centre seek more investments, paid for by taxing the rich, while the FDP seeks widespread tax reductions. How do you want to frame the position of your party?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 721, \"fields\": {\"priority\": 1, \"description\": \"Shook to your core, you read the headline of the 11/2021 issue of<i> Der Spiegel</i>: <br>” <i>‘Schwarzer Filz’ - Mask deals, venality, failure in crisis: the deep fall of the Union. </i> “<br>They reveal how several CDU/CSU MPs are implicated as part of a corrupt scheme to sell overpriced medical masks to government organizations, in order to profit from the crisis. Journalists run in your door, asking for a comment on the first crisis of your party leadership.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 722, \"fields\": {\"priority\": 1, \"description\": \"April 2021: Minister of Finance and current Vice Chancellor Olaf Scholz has been declared chancellor candidate by the SPD last year already and there are rumors the Green party is about to nominate either Annalena Baerbock or Robert Habeck soon. Do you want to formally declare your candidacy before they do?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 723, \"fields\": {\"priority\": 1, \"description\": \"Söders ambitions were always clear, but this is shaping out to be a blatant confrontation. <br>You and Söder both want to become the chancellor candidate for the Union of CDU/CSU. You have some bully pulpit at your side - although polling shows Söder to be more popular than you. How do you want to decide this contest?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 724, \"fields\": {\"priority\": 1, \"description\": \"Wow, that was a close one! First, let’s take a breath. <br>Now, you have finally jumped the last hurdle and formally became the chancellor candidate of the CDU/CSU. Congratulations! What talking point do you want to hit on at the press conference?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 725, \"fields\": {\"priority\": 1, \"description\": \"The Green party has, for the first time in its history, nominated a chancellor candidate, Annalena Baerbock. In a development few would have expected four years ago, she appears to be your main contender, even polling ahead of you sometimes, while Olaf Scholz of the SPD is far behind in third place. What’s your strategy regarding your two opponents?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 726, \"fields\": {\"priority\": 1, \"description\": \"Michael Kretschmer, your party colleague and Minister-President of Saxony, has recently traveled to Moscow and has been criticized for that visit. What’s your stance on current policies regarding Germany’s relationship with Russia and Putin?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 801, \"fields\": {\"priority\": 1, \"description\": \"You’re invited to a talk show about immigration and refugees. Although tempers have cooled a bit since 2015, the discussion around Merkel's decision to welcome the refugees 6 years ago is still relevant - particularly for the AfD, who got driven into parliament on this issue in 2017. Germany is still a popular destination for many foreigners seeking a better life, yet the nation does not seem prepared for this. What stance do you take in this debate?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 727, \"fields\": {\"priority\": 1, \"description\": \"May 2021: A bombshell has rocked the Grand Coalition: the Federal Constitutional Court just ruled the Climate Protection Act unconstitutional and demands the government do more to lower emissions. Berlin has already gone to work on making the law stricter. What is your opinion on this issue?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 802, \"fields\": {\"priority\": 1, \"description\": \"Up until now, your campaign has been dominated by a very centrist attitude, tilting center-left even. To many, this seems evocative of Angela Merkel, but some party cadres, particularly around Friedrich Merz, are worried about their core values. In an internal meeting, you’re asked frankly: do you plan to keep this up?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 728, \"fields\": {\"priority\": 1, \"description\": \"More and more people are receiving a Covid vaccine, though not everyone has been granted access yet. Older people are starting to get the shot, while some who are younger are frustrated to wait. Do you have a comment on how to move forward with the vaccination campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 729, \"fields\": {\"priority\": 1, \"description\": \"You have been invited to give a speech about German foreign and defence policy. Members of the Bundeswehr stand in the crowd: they eagerly listen to what direction you want Germany to take on the world stage. Which talking points do you emphasize?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 803, \"fields\": {\"priority\": 1, \"description\": \"One topic of many discussions is the ongoing change in age demographics, particularly its impact on the pension system. Currently, 67 is the legislated retirement age for people born after 1964, after which your earned pension is gradually given to you from a pension fund that the current workforce pays into. However, due to Germany's low birth rates, the system is thought to be unsustainable. How do you want to address this problem?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 730, \"fields\": {\"priority\": 1, \"description\": \"June 2021: Things look to be on somewhat of an upswing. Baerbock seems to falter to some negative headllines, and on top, the CDU was the big winner at the provincial elections in Saxony-Anhalt, with Minister-President Reiner Haselhoff’s popularity being credited. What’s your reaction to this information?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 804, \"fields\": {\"priority\": 1, \"description\": \"With the campaign developing, Annelena Baerbock has caught criticism from the media. She’s dealing with numerous scandals: allegations of plagiarism in her book, an inconsistent CV, as well as failing to report extraparliamentary earnings on time. With her seemingly being your main opponent, how do you want to capitalize on this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 731, \"fields\": {\"priority\": 1, \"description\": \"Digitalization is an important topic in this election, with Germany often perceived as surprisingly archaic in comparison to its neighbors, frequently seen on the tail end of statistics. With all parties unveiling plans to rectify this, what focus do you want to lay?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 805, \"fields\": {\"priority\": 1, \"description\": \"One of the more salient issues in the current political landscape across the western world is the question of rents, particularly for younger voters. Most economic and educational opportunities increasingly lie in the big cities of the country - where rent is constantly increasing, to the point where it becomes a serious political question. What is your answer to the housing question?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 732, \"fields\": {\"priority\": 1, \"description\": \"July 2021: Catastrophe hits. The meteorological low-pressure area <i>Bernd</i> has hit Central Europe and made several rivers burst over their banks. Disastrous rain and floods are affecting large areas of Germany. The state you govern, North Rhine-Westphalia, is among the most affected - you are asked to comment.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 733, \"fields\": {\"priority\": 1, \"description\": \"Post-flood cleanup operations are going on as the full devastation of the flooding becomes clear: 220 fatalities, 186 of those in Germany, the deadliest flood since 1962.<br>Among the mourning, your advisors want you to position yourself as a man of action.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 734, \"fields\": {\"priority\": 1, \"description\": \"Climate change is a much-discussed topic again after the floods - it seems dire warnings of extreme weather events are starting to come true. In the wake of this, you have been asked if this had an impact on your stance on how to best combat climate change.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 735, \"fields\": {\"priority\": 1, \"description\": \"After early successes, the vaccination campaign has become sluggish in recent weeks. Most vulnerable groups have been taken care of, but some vaccine-critical or lethargic people have been on the holdout for their shot. Some media figures are now going as far as to demand making the vaccine mandatory. What do you think of this?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 736, \"fields\": {\"priority\": 1, \"description\": \"August 2020: The SPD under Olaf Scholz has been surging in the polls, drawing votes from both you and the Green Party. There are still many undecided voters too, though: your advisors want to produce a good and impactful ad to hopefully sway some people in the home stretch of this campaign. What input do you give them?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 806, \"fields\": {\"priority\": 1, \"description\": \"A bit of a minor issue, but one that has gripped the imagination of many young voters is the topic of cannabis. Currently, it is a controlled substance, and illegal to produce, distribute or own. In light of worldwide movements to decriminalize or even legalize it: <i>Wann Bubatz legal</i>?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 737, \"fields\": {\"priority\": 1, \"description\": \"There are 7 parties poised to enter parliament, and none has ever won an absolute majority since Adenauer in 1957. As such, it is basically guaranteed that there will be a coalition government after the elections. You are asked ad-nauseam - who would you enter a coalition with?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 807, \"fields\": {\"priority\": 1, \"description\": \"One social issue with an actual impact on people’s lives is the question of abortion. Currently, the infamous criminal law §218 disallows abortions generally, but decriminalizes them in case of rape, or if the pregnancy is less than 12 weeks old and a consultation has taken place. Additionally, the §219a establishes an “ad ban” for doctors offering abortions. You’re asked for your stance on this controversial topic.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 738, \"fields\": {\"priority\": 1, \"description\": \"September 2021: Pictures of the disastrous retreat of NATO troops from Afghanistan go around the globe. Many loyal locals are left behind, as the Taliban are poised to make a comeback. The government is sharply criticized for its botched evacuation - what stance do you want to take?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 739, \"fields\": {\"priority\": 1, \"description\": \"September 2021: TV debates are a relatively recent phenomenon in Germany, only being consistent since 2002. Now, for the first time in German history, there will be a three-way debate, a so-called “Triell”. You, Olaf Scholz and Annalena Baerbock are all invited. What is going to be your strategy?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 740, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Olaf Scholz, vice chancellor and candidate of the SPD. There are plenty of avenues to attack him and stun his momentum - which talking points do you emphasize?\", \"likelihood\": 1.0}},{\"model\": \"campaign_trail.question\", \"pk\": 808, \"fields\": {\"priority\": 1, \"description\": \"Along with the <i> Triell </i>, another TV debate is commonly held among surrogates of the smaller parties; the so-called <i>Vierkampf</i>. While the Greens have seemingly eclipsed the other Bundestag parties, it’s Janine Wissler of Die Linke, Christian Lindner of the FDP, Alice Weidel of the AfD and Alexander Dobrindt of the CSU, the smaller sister of the Union, debating about the issues of the day.\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 743, \"fields\": {\"priority\": 1, \"description\": \"The 26th of September is almost here. Finally, this historically important campaign is coming to an end. Hopefully, though, 16 good years of CDU governance won’t! In your final lap for this year, you have a chance to get some support from a political ally. Who do you want to campaign with?\", \"likelihood\": 1.0}}]");
extraQuestions = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 741, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to focus on Annalena Baerbock, chancellor candidate of the Greens. Earlier scandals have already hurt her campaign, and you may now deliver the coup de grace. What do you want to emphasize?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 742, \"fields\": {\"priority\": 1, \"description\": \"During the Triell, you decided to take the high road, and focus on making your case to the German people without mudslinging. There are many policies in the CDU/CSU programs, and you can employ different strategies of presenting yourself to the audience. How do you want to do that?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 809, \"fields\": {\"priority\": 1, \"description\": \"Up until now, your campaign has embraced a classically moderate-conservative Christian Democracy, mostly following the center-right party doctrine. Some advisors want you to pivot further left towards the median voter, while others want you to take the AfD’s wind out of their sails. In an internal meeting, you’re asked frankly: do you plan to keep this up?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 810, \"fields\": {\"priority\": 1, \"description\": \"Up until now, your campaign has been met with a noticeable hardline-conservative tone,  seemingly wanting to take the party rightwards, somewhat evocative of the CDU pre-Merkel. In an internal meeting, you’re asked frankly: do you plan to keep this up?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 4000, \"fields\": {\"question\": 717, \"description\": \"I am the Minister-President of North Rhine-Westphalia, the most populous state in Germany. The CDU is the party of competence - and none of my opponents has held a political office in the last few years. I will bring my expertise in modern governance to the national level.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4001, \"fields\": {\"question\": 717, \"description\": \"Out of the three candidates nominated, I am the only one who has actually won an election and in a former SPD-stronghold nonetheless, in a strong black-yellow coalition. It is crucial that we win the Bundestagswahl this fall, and I am the right man to do it!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4002, \"fields\": {\"question\": 717, \"description\": \"I am more conservative than Röttgen and more liberal than Merz. By positioning myself between those two, I can split them apart and draw votes from whoever is knocked out on the first ballot - I’ll then win the second ballot by default.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4003, \"fields\": {\"question\": 717, \"description\": \"The party officials are largely behind me. They should push for me behind closed doors to make sure I win this contest. I will already focus on convincing swing voters for the election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4004, \"fields\": {\"question\": 718, \"description\": \"I want to continue the legacy of the Merkel-era as much as possible. Her sixteen years of chancellorship were outstanding, and I promise to continue on that course.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4005, \"fields\": {\"question\": 718, \"description\": \"The CDU is the party for the middle of society. I will continue moving the party into the future, with a moderate and pragmatic course on the issues of the day.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4006, \"fields\": {\"question\": 718, \"description\": \"The strong showing of Merz has shown that the right wing of the party has too often been ignored by Merkel. Under my leadership, we will bring the party back on a more conservative path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4007, \"fields\": {\"question\": 718, \"description\": \"While I will praise Merkel for her outstanding career, we need to acknowledge the challenges of the 21st century: particularly climate change. It is important that we don’t leave this topic to other parties, but present solutions of our own, that go beyond what we are doing now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4008, \"fields\": {\"question\": 719, \"description\": \"While the lockdowns were the right thing to do, now that the winter is over and we have started to vaccinate people, it is time to return to normalcy. North Rhine-Westphalia will open up quickly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4009, \"fields\": {\"question\": 719, \"description\": \"The situation is still very volatile and it is better to be cautious than reckless. We should keep the lockdowns for the foreseeable future, and only open up on strict criteria.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4010, \"fields\": {\"question\": 719, \"description\": \"While I’m all for opening up, we should keep an eye on the number of infected people and have a bridge lockdown during Easter if the case numbers become too high.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4011, \"fields\": {\"question\": 719, \"description\": \"This is a decision that the federal government and the states have to make together. I will wait and see what this process achieves and go with the majority opinion.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4012, \"fields\": {\"question\": 720, \"description\": \"Under no circumstances will we raise taxes, but we don’t want to dramatically lower them. We will phase out the extra tax of the Soli and try to reduce the burden on small and medium-income earners while always keeping the budget balanced, in keeping with the “Black Zero”.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4013, \"fields\": {\"question\": 720, \"description\": \"The Covid crisis has left a massive hole in our budget that we have to plug somehow. We have to be measured, but a tax increase will likely be unavoidable to avoid harsh debts that can hurt our economy even further.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4014, \"fields\": {\"question\": 720, \"description\": \"Taxes for private households should stay where they are or even be lowered by phasing out the Soli. More importantly, corporate taxes should be lowered to unleash the full economic potential of this country. As little State as necessary, as much market as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4015, \"fields\": {\"question\": 720, \"description\": \"To stimulate the economy after the Covid crisis, taxes have to be lowered across the board for both private households and corporations. We also have to streamline tax bureaucracy, and consider new solutions, in the form of flat tax proposals for example.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4016, \"fields\": {\"question\": 721, \"description\": \"I was as shocked as everyone else when I found out about this! The parliamentary immunity of these MPs should promptly be removed so they can be properly investigated. Corruption has no place in the CDU/CSU!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4017, \"fields\": {\"question\": 721, \"description\": \"Let’s wait and see how this develops. I’ll issue a brief statement that we want to wait until it’s clear what actually happened.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4018, \"fields\": {\"question\": 721, \"description\": \"This is nothing but a political hit job by a left-wing magazine in an election year. I’m sure further investigations will prove the innocence of these MPs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4019, \"fields\": {\"question\": 721, \"description\": \"Let us be pragmatic. Two of our MPs may have indeed shown low moral inhibitions, but we shouldn’t judge the whole party based on the actions of two people. We support this investigation as much as anyone else, these are individual black sheep.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4020, \"fields\": {\"question\": 722, \"description\": \"This seems like a good time to declare my candidacy, yes. Though before I declare, I will make a courtesy call to Markus Söder, the party leader of our sister party, the CSU, to make sure he won’t oppose me.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4021, \"fields\": {\"question\": 722, \"description\": \"Yes, I will inform the upper party echelons and formally announce this during a press conference in my home state. There is no time to lose! It’s time for the campaign to get going.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4022, \"fields\": {\"question\": 722, \"description\": \"You know, it might be better to wait this out a bit longer - just biding our time and consolidating our party influence. I can declare after whatever announcement the Green party makes to get them out of the limelight.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4023, \"fields\": {\"question\": 723, \"description\": \"It wasn’t an easy decision. I thought about this long and hard, but I want to retract my candidacy. Söder is a competent man, has better polling numbers, many of our party members support him and I’m quite happy here serving as Minister-President of North Rhine-Westphalia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4024, \"fields\": {\"question\": 723, \"description\": \"Let’s call every big name in the party, curry every favour, maybe we can even get Merkel herself to weigh in. I can’t have this decided by vote and risk being humiliated, I want this decided by the party elites now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4025, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Söder - his support primarily comes from Bavaria and I have the traditional prerogative as leader of the bigger party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4026, \"fields\": {\"question\": 723, \"description\": \"The party parliamentary group of CDU and CSU shall vote on this. I’m confident they will pick me over Söder - his support primarily comes from Bavaria and I have the traditional prerogative as leader of the bigger party.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4027, \"fields\": {\"question\": 724, \"description\": \"First and foremost, I want to thank Markus Söder for accepting this outcome. We have to be united as a party to win this fall. Apart from that, I will hit my usual talking points, about stability, pragmatism, praising Merkel and acting on our values.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4028, \"fields\": {\"question\": 724, \"description\": \"This closer-than-expected contest has convinced me that I need to move my position and change my attitude on some topics. I’ll focus on how dealing with the pandemic and not opening up too quickly is of critical importance, how we need strong leadership in these trying times and new ideas to move forward, to build on Angela Merkel's successes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4029, \"fields\": {\"question\": 724, \"description\": \"I will give a largely non-political speech. We need to focus on the importance of cohesion and trust in our society, to come together as one in the wake of this crisis, not letting our different views divide us, and the values of honest work. I want to bring up the anecdote about my father, who was a miner. A statesman is what we need right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4030, \"fields\": {\"question\": 724, \"description\": \"The success of the AfD showed us that this country is in dire need of change and a new direction, away from the Status Quo. I will promise to modernize Germany while letting our conservative values guide us in this progress. A new Germany, responsible and sensible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4031, \"fields\": {\"question\": 725, \"description\": \"The Green party is always surging a few months before elections and comes crashing down in time, just like in 2011 after Fukushima. I’m not too worried - we should still focus more on competing with the SPD, our traditional opponent.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4032, \"fields\": {\"question\": 725, \"description\": \"I will take this development very seriously, clearly the demand is there to take the climate more seriously. Let’s unveil some of our own environmental policies to stop their momentum and defuse some of their criticisms.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4033, \"fields\": {\"question\": 725, \"description\": \"Off the record, it’s not the worst thing that these two parties compete for centre-left votes. This makes the path to first place a lot easier. Let’s focus somewhat on the Greens as our main contender in that regard, and just attack them moderately where we can.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4034, \"fields\": {\"question\": 725, \"description\": \"Actually, this is a bit ridiculous and reminds me of the publicity stunt the FDP pulled in 2002 when they nominated Guido Westerwelle as chancellor candidate. Let’s mock them for their hubris and don’t refer to Baerbock as a legitimate chancellor candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4035, \"fields\": {\"question\": 726, \"description\": \"It is important that we don’t demonize Putin and keep our dialogue open. I’m critical of many things the Russian leadership has done, but overall, we should strive to cooperate with them, as we do on the Nord-Stream 2 pipeline.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4036, \"fields\": {\"question\": 726, \"description\": \"I’ve been more lenient in the past, but enough is enough. I will join in with the criticism against Kretschmer and call for a tougher stance towards Putin. Maybe we should only open the Nord-Stream 2 pipeline if we get some concessions from Russia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4037, \"fields\": {\"question\": 726, \"description\": \"Kretschmer is completely right, we have to talk more with Russia, not less. I’m all in favor of more dialogue and stronger economic ties with Russia. Besides, it’s not like the USA has never done anything wrong.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4038, \"fields\": {\"question\": 726, \"description\": \"This whole thing is overblown, this trip was mostly for cultural exchange. I don’t have much to say about this. We stand on our commitment to Nato.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4501, \"fields\": {\"question\": 801, \"description\": \"I supported Merkel's decision at the time, we needed to take those people in to prevent a humanitarian catastrophe at the Austrian-Hungarian border. Today though, we need to be more mindful of European border security. To that end, we want to strengthen the EU border enforcement agency Frontex.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4502, \"fields\": {\"question\": 801, \"description\": \"There’s no way around it - Germany is an immigration country. We need a comprehensive overhaul of our immigration laws - we don’t have a good system in place to attract qualified immigrants, who could be advantageous to our economy and demographic situation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4503, \"fields\": {\"question\": 801, \"description\": \"Merkel was absolutely right to take in these people. We’re saying: Refugees Welcome! As a western country partially responsible for colonialism, we have a responsibility for humanitarian aid, including initiatives to rescue capsized refugee boats in the mediterranean.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4504, \"fields\": {\"question\": 801, \"description\": \"On this issue, Merkel has erred - her rhetoric was dangerous in provoking even more refugees and immigrants to come here. We simply can’t take everyone. We need more border security in the EU and faster deportation processes to avoid another disaster - 2015 can’t repeat itself.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4039, \"fields\": {\"question\": 727, \"description\": \"This was a bad decision by the court. The Climate Protection Act already went far enough and I’m not in favor of hurting the economy with a stricter climate policy. We need to look out for our workers and industry, fear is not the answer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4040, \"fields\": {\"question\": 727, \"description\": \"It is important that we quickly implement the new law. I’m especially in favour of a price for CO<sub>2</sub> that is formed by market forces. We have to make sure that everyone can keep affording their energy bills, though, and we need to use this opportunity to create new jobs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4041, \"fields\": {\"question\": 727, \"description\": \"We have to become carbon neutral long before 2050. I’m sure the government under Merkel will come up with a sensible solution, which I will continue as chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4042, \"fields\": {\"question\": 727, \"description\": \"With the decision by the court, we now have a great opportunity for an ambitious new Climate Protection Act. I advocate for Germany to be carbon neutral by 2040 and to accelerate the transition to renewable energies. We simply can’t wait anymore.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4505, \"fields\": {\"question\": 802, \"description\": \"Yes, I do. Angela Merkel is a highly esteemed stateswoman and one of the best chancellors this country ever had - although to modernize our party, we have to recalibrate our course on climate change and protecting our social safety net. The CDU is an innovative party of the 21st century, and I will not let myself get intimidated by right-wing demagogues.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4506, \"fields\": {\"question\": 802, \"description\": \"I do not think in ideological categories, I’m simply standing for what I think is good for Germany. The CDU is the party of good governance - not radicalism, both leftist or rightist.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4507, \"fields\": {\"question\": 802, \"description\": \"I wanted to begin this campaign by bringing us all together - now we can try to tilt the discourse rightwards, taking Merkel supporters with us while framing our conservative positions as more reasonable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4043, \"fields\": {\"question\": 728, \"description\": \"We need to open up quickly for vaccinated people. A return to normalcy has never been so close, and we all had more than enough of lockdowns - not every measure might still be proportionate. Vaccinated people have less risk and thus should receive more benefits.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4044, \"fields\": {\"question\": 728, \"description\": \"We are currently in a very critical phase of the pandemic, a phase in which cohesion could easily be endangered. Vaccinated people should be exempt from some restrictions, but let’s not go overboard. We need to move forward together and be patient until science tells us that it’s safe.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4045, \"fields\": {\"question\": 728, \"description\": \"It’s important that as many people as possible get vaccinated as quickly as possible so we can overcome this crisis, but that’s not what’s happening. Maybe we should question the prioritization system we have right now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4046, \"fields\": {\"question\": 728, \"description\": \"The vaccine seems helpful now, but we haven’t had a chance to study its side effects yet. We should be mindful of our bodily health and not be too quick in our judgment - I advocate for a slowdown of the vaccination campaign until we have more information.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4047, \"fields\": {\"question\": 729, \"description\": \"For years and years, we have consistently missed the NATO aim to spend 2% of our gross domestic product on defense. I strongly reaffirm our commitment to NATO and this goal! The West has to be united against potential threats.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4048, \"fields\": {\"question\": 729, \"description\": \"While I strongly reaffirm our support of a united Alliance and strong defense, I specifically want to call out Annalena Baerbock. She lacks a clear commitment to NATO, which is not appropriate for a chancellor.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4049, \"fields\": {\"question\": 729, \"description\": \"I want to praise the work we’ve done so far and believe we are in a good spot. While I strongly reaffirm my commitment to NATO, we don’t need to spend more on defense than we do right now; we need to combat waste first and foremost.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4050, \"fields\": {\"question\": 729, \"description\": \"NATO is a relic of the cold war. We should stay a member for now, but we should also try to find avenues for cooperating with other nations, keep reaffirming our neutrality, and open up new dialogues with Russia or China.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4508, \"fields\": {\"question\": 803, \"description\": \"The heart of this problem lies in Germany's low birth rates. We need to further encourage the founding of families, with benefits for married and childbearing couples. Family-friendly policies like government grants to support family homes will strengthen our social cohesion, our collective values and invest in our future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4509, \"fields\": {\"question\": 803, \"description\": \"Germany does have low birth rates, but one answer to keep our social support net afloat lies in immigration. We are an attractive place in Europe for many seeking a safe and economically secure future, and we should finally implement a real immigration law, for example with a Canada-style point-system.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4510, \"fields\": {\"question\": 803, \"description\": \"It's clear that the current system is unsafe. We should build on our public pension system, reform private options like the Riester-system and ensure current pension levels, as well as refrain from raising the pension age any further! We also need to introduce a higher state-provided minimum pension to fight old-age poverty.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4511, \"fields\": {\"question\": 803, \"description\": \"We need to overhaul the bureaucratic costs of the system and listen to the decisions of the advisory councils. The mix of public, occupational and private pension systems contribute to safe pension levels, particularly the occupational and private capital-covered retirement provisions should be strengthened. We can also look at Swedish-style stock-based pension funds.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4051, \"fields\": {\"question\": 730, \"description\": \"I want to congratulate Haseloff for his strong performance. It shows that the citizens still trust the CDU to be the best governing party, and we want to emulate his strategy on a national scale.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4052, \"fields\": {\"question\": 730, \"description\": \"Haseloff performed very well, but I want to emphasize that the AfD lost votes. When we keep appealing and listening to all people, without prejudice, we can win them back for the democratic parties.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4053, \"fields\": {\"question\": 730, \"description\": \"This was a very strong performance. To show my gratitude, I will make an extra trip to Saxony-Anhalt and campaign with him for some nice pictures.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4512, \"fields\": {\"question\": 804, \"description\": \"We should definitely hit her on these topics. This is unprofessional behavior that should not happen in the chancellery. These concerns about her integrity have to be addressed.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4513, \"fields\": {\"question\": 804, \"description\": \"Not only that - did you notice how she used the N-Word in that interview, and had to be censored out? Such mistakes of communication are unacceptable for a chancellor, and the problematic nature of this faux pas should sheds doubt on her character.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4514, \"fields\": {\"question\": 804, \"description\": \"People can make their own decisions about this, what I want to talk about is substance. Her policies are expensive for the middle class and ineffective, and she knows it. She talks - I act.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4515, \"fields\": {\"question\": 804, \"description\": \"People aren’t clamoring for my comments here, they will be judged on their own. I want to stay positive and talk about the successes I will bring to Germany.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4054, \"fields\": {\"question\": 731, \"description\": \"The pandemic has shown how ill-prepared our schools are. We need to continue improving digital infrastructure in education, through more training, technical assets and a national educational platform. That is what the CDU/CSU has worked on, and will continue doing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4055, \"fields\": {\"question\": 731, \"description\": \"Actually, we don’t have much to gain by talking about this topic - many voters see us as responsible for the current situation. Let’s downplay it as much as we can and focus on issues where we are seen as more competent, like matters of security or debt.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4056, \"fields\": {\"question\": 731, \"description\": \"We definitely need to modernize the digital infrastructure of Germany, especially in the public sector. Administrative matters have to be more accessible to citizens, we need to digitize all internal processes and cut down on bureaucracy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4057, \"fields\": {\"question\": 731, \"description\": \"Digitalization is a key issue - we need a digital transformation offensive. I want to especially emphasize that we will accomplish a nationwide 5G mobile network by 2025 and provide 15 billion Euros for Gigabit-networks. To that end, we will also establish a Ministry of Digital Innovation and Transformation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4516, \"fields\": {\"question\": 805, \"description\": \"We need to alleviate the housing market by building more. We need to build more than 100.000 housing units, using tax benefits. We should also provide funding to revitalize our cities and villages, advertise rural spaces and reduce the real estate transfer tax - every family should be able to own a home.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4517, \"fields\": {\"question\": 805, \"description\": \"We need to emphasize the creation of more social housing, built by modern standards available for those who need it most. For families, we can make buying empty buildings in the countryside easier for young people, as we do in NRW. Furthermore, we need to fight land speculation and close tax loopholes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4518, \"fields\": {\"question\": 805, \"description\": \"The situation is tense. It’s clear that action is needed in the form of rent controls. A sharper, unlimited federal rent control program should be introduced. In places where the situation is very problematic, we stand for a so-called ‘rent moratorium’, where rent would only be able to increase with the inflation rate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4519, \"fields\": {\"question\": 805, \"description\": \"We are vehemently against programs like rent controls. Social housing projects have failed to improve the situation - instead we need to support low income renters through housing subsidies. Regulations have to be cut back, we need slimmer bureaucracies and faster approval processes so that the market can sort itself out.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4058, \"fields\": {\"question\": 732, \"description\": \"The most important thing we can do right now is help the affected regions with their crisis management. They need help now, quickly and unbureaucratically. I’m promising swift support.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4059, \"fields\": {\"question\": 732, \"description\": \"I want to especially praise local teams and local reactions. Some areas already had crisis teams ready when the sun was still shining and no one knew what would happen. We will follow up and provide a better crisis responses in the future.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4060, \"fields\": {\"question\": 732, \"description\": \"First, we need to quickly and diligently help the affected regions with the cleanup operations. After that, we have to guarantee financial emergency aid for affected people, unequivocally.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4061, \"fields\": {\"question\": 732, \"description\": \"I want to honor the victims, but also address the cause of all this: climate change. extreme weather events are unfortunately going to become more common -  we need to act decisively and swiftly now to keep global warming below 1.5°C so that we can prevent these disasters.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4062, \"fields\": {\"question\": 733, \"description\": \"Actually, I don’t want to be seen as performative. The cleanup operations can be left to professionals, I will keep coordinating the crisis efforts from the state chancellery so that everything goes smoothly - that’s the best I can do for the victims.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4063, \"fields\": {\"question\": 733, \"description\": \"I want to get out there, yes. I have to look at the carnage myself, at least for a day or two. NRW is among the most affected states after all. Let’s try to keep my visits below the radar though, so we don’t generate too much media buzz - that could be seen as opportunistic. Maybe some interviews with local newspapers and radio stations.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4064, \"fields\": {\"question\": 733, \"description\": \"What a great idea! We should get out there and visit some affected towns - our President Frank-Walter Steinmeier will be here in a few days, so let’s try to get some shared pictures with our head of state. Catch some of his gravitas.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4065, \"fields\": {\"question\": 733, \"description\": \"What a great idea! We should get out there and visit some affected towns - German President Frank-Walter Steinmeier will be here in a few days, so let’s try to get some shared pictures with our head of state. Catch some of his gravitas.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4066, \"fields\": {\"question\": 734, \"description\": \"The floods have shown that we need to be much more ambitious than before. One of the worst offenders is our energy production: we need to stop using coal for energy generation by 2030 and seek out new innovative technologies to keep energy affordable.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4067, \"fields\": {\"question\": 734, \"description\": \"Climate change is coming, whether we want it or not. The most important thing we can do is mitigate its worst effects to prevent catastrophes like this from doing too much damage - we need better crisis responses. Climate action is necessary, as long as it doesn't stifle our economy and freedom of living.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4068, \"fields\": {\"question\": 734, \"description\": \"Germany is no stranger to floods. I’m sorry, but just because today is a day like this, you don't just change your politics. The question of climate change is an international one, we can’t trivialize it like this.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4069, \"fields\": {\"question\": 734, \"description\": \"We clearly need to pick up the pace on climate action. But if you look back, it’s the environmentalist movement who concentrated on the wrong issue; for 20 years they’ve fought to end nuclear energy, instead of coal. Germany now exits nuclear as pretty much the only country, our focus is misguided.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4070, \"fields\": {\"question\": 735, \"description\": \"Compulsion is the wrong way to go about this, and probably unconstitutional. Instead, we need to convince people of the dangers of not being vaccinated and to continue our information campaign as we are now.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4071, \"fields\": {\"question\": 735, \"description\": \"While I wouldn’t go that far, as we might run into legal issues, we should give people more incentives to get vaccinated. One solution might be to open up certain establishments from the lockdown, but only for vaccinated and recovered people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4072, \"fields\": {\"question\": 735, \"description\": \"Covid is basically over, the case numbers are very low. One has to be honest and ask: Do we even need such an expensive program? Vaccines are good to have, but we should focus on opening up and treating Covid as the non-problem it has become.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4073, \"fields\": {\"question\": 735, \"description\": \"This might be a good idea. The country needs to move on, we need to do everything we can to finally make Covid history. At some point, we need to have the conversation about mandatory vaccines, and fine those that refuse to get one.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4074, \"fields\": {\"question\": 736, \"description\": \"We have to modernize my image. Let’s incorporate some biographical elements, like that my father was a miner, and show pictures of how I closed the last mine in North Rhine-Westphalia. Then talk about tackling climate change together and how we need to promote tolerance.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4075, \"fields\": {\"question\": 736, \"description\": \"Covid is still on the mind of most people. Let’s focus on my response to this crisis, show me in a lab coat or something. With a strong vaccination campaign, we will continue Merkel's course and bring normalcy back!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4076, \"fields\": {\"question\": 736, \"description\": \"It’s best to play it safe. My motto is “Making Germany Together” - I want a spot about how I’m bringing different people together and how our country needs solidarity in this crisis. Let’s show the diversity in our supporters and promise that we will bounce back stronger than before.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4077, \"fields\": {\"question\": 736, \"description\": \"I’ve been governing North Rhine-Westphalia successfully since 2017. I want to talk about my home, show my successes here and promise to bring them to Germany, as a <i>Landesvater</i>. Give off an air of trustworthiness - let’s even invoke my Green colleagues’ Winfried Kretschmanns “You know me.”-quip.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4520, \"fields\": {\"question\": 806, \"description\": \"Cannabis is a societal reality, like alcohol. We should start to take steps towards a regulated distribution to adults, accompanied by addiction prevention measures. The possession of small amounts shouldn’t be prosecuted anymore.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4521, \"fields\": {\"question\": 806, \"description\": \"We are against the legalization of illegal drugs. The risks for the individual and society are too great - instead, we should work towards addiction prevention, as well as early and suitable sanctions, that incentivise taking counseling and therapy. We do acknowledge the medical usage of Cannabis, however.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4522, \"fields\": {\"question\": 806, \"description\": \"Legalize it! We are for permitting the controlled distribution of Cannabis, through regulated sales in licenced shops. We do need projects to prevent drug abuse and youth protection though, financed through consumption taxes, as well as a legal framework around marihuana usage.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4523, \"fields\": {\"question\": 806, \"description\": \"Not at all: we need to further pursue drug users and lower the amount of cannabis that is legally prosecuted. Our goal is a drug free society. Look at the Netherlands, they have decriminalized the possession of just 5 grams, with fatal consequences - that won’t happen to our children.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4078, \"fields\": {\"question\": 737, \"description\": \"We will talk with all democratic parties - the SPD, the Greens and the FDP. However, I want to needle the leftist parties for not ruling out a coalition with the extremist Left. They are fringe populists, unfit to govern.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4079, \"fields\": {\"question\": 737, \"description\": \"We rule out coalitions with the extremes. Normally we would talk with everyone in the center, but it’s clear how a continuation of the Grand Coalition of the last 8 years would not have a public mandate. We need to find a different governing majority.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4080, \"fields\": {\"question\": 737, \"description\": \"The last few years have shown how we can not ignore the 10-15% of the populace voting for the AfD. This country needs change and new solutions. I think a Bahamas coalition with the AfD and the FDP could work - Austria showed us how the right wing can govern harmonically.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4081, \"fields\": {\"question\": 737, \"description\": \"My favorite coalition would be Black-Yellow, like the one I’m leading in North Rhine-Westphalia now. The FDP is a reliable partner, and we could get some really good policies done together.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4524, \"fields\": {\"question\": 807, \"description\": \"While §218 is a settled compromise from our societal discussions, we are for striking the §219a ad ban: women who are deciding on an abortion in a conflict situation need unrestricted access to information. Additionally, we need to train more doctors and prevent pressure from abortion opponents in front of clinics.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4525, \"fields\": {\"question\": 807, \"description\": \"We want to strike $218, 219 and 219a from the books completely. Pregnancy issues are not part of criminal law, while abortion is a medical service that has to be managed as part of regular health care. The stigma has to be broken, and the supply of doctors offering abortion has to be increased.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4526, \"fields\": {\"question\": 807, \"description\": \"The current situation is fine as is. Unborn life does have a right to be protected. Furthermore, the ad ban has already been loosened two years ago, to provide better access to information for affected women and legal certainty for doctors and hospitals, if an abortion is necessary.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4527, \"fields\": {\"question\": 807, \"description\": \"The right to life does not stand to disposition. The unborn child has a right to live, and we stand vehemently against efforts to trivialize or encourage abortions from the state. Instead, adoption procedures have to be simplified - while doctors who do not report abortions should incur noticeable sanctions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4082, \"fields\": {\"question\": 738, \"description\": \"This is the biggest debacle for NATO since its founding, but also a miscalculation on the part of the government. We need a relentless analysis of what went wrong. I also need to criticize the USA’s role in this, the mandate for our troops still went until 2022, but we can’t hold it down alone.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4083, \"fields\": {\"question\": 738, \"description\": \"It’s a disgrace how so many good people would now have to live under civil strife and a possible Taliban takeover. We need to take in more refugees from Afghanistan, especially people who cooperated with the German troops. We owe it to them, after their generous help!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4084, \"fields\": {\"question\": 738, \"description\": \"Foreign Minister Heiko Maas of the SPD is clearly to blame for our part in this crisis, and has to take political responsibility. He should have started the evacuations much earlier, and there should be direct repercussions for his position.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4085, \"fields\": {\"question\": 738, \"description\": \"Okay, uh… one thing’s clear, we can’t have a repeat of the refugee crisis in 2015. Let’s tell them, we are watching the situation closely, but we concur with Interior Minister Horst Seehofer that criminal refugees still have to be sent back to Afghanistan, with a zero-tolerance policy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4086, \"fields\": {\"question\": 739, \"description\": \"Olaf Scholz has been surging a lot in the polls recently and privately, I worry that he will not stop. We compete for a lot of voters with his wannabe-Merkel attitude - it seems foolish to do anything but attack him on his many weaknesses.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4087, \"fields\": {\"question\": 739, \"description\": \"Baerbock has been struggling lately, but the Greens are still a strong party with a vulnerable candidate, and some voters we could pick up. Let’s focus on her.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4088, \"fields\": {\"question\": 739, \"description\": \"I will leave petty attacks to my opponents and focus more on policy. I’m certain the German people will appreciate hearing concrete solutions to their problems more than attacks. This isn’t America.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4089, \"fields\": {\"question\": 739, \"description\": \"Actually, I don’t want two left-wing politicians to gang up on me. This format is not up to the times and I can guarantee, time will not be allotted fairly to the only centrist party at the table. Thus, I must decline this invitation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4090, \"fields\": {\"question\": 740, \"description\": \"He likes to present himself as a moderate, but he hasn’t completely ruled out a coalition with the extremist Left party. Can voters really trust him not to form a coalition with populist demagogues after the election?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4091, \"fields\": {\"question\": 740, \"description\": \"Let’s hit him on his scandals as finance minister. Under his watch, Wirecard collapsed due to fraudulent dealings and lots of people lost their money. We need to poke attention to the police raid on a government office belonging to his ministry - he refuses to take responsibility.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4092, \"fields\": {\"question\": 740, \"description\": \"Scholz likes to pretend he’s a moderate, but the program of his party is very leftwing, especially regarding pensions and the minimum wage. It shows that the SPD as a whole is unfit to govern.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4093, \"fields\": {\"question\": 740, \"description\": \"Actually, I’ve changed my mind. The mudslinging isn’t worth it - after giving my usual critiques I’ll just wing it and rely on my instincts as a statesman to rise above the pack.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4094, \"fields\": {\"question\": 741, \"description\": \"She’s had problems with plagiarism in her book, and she inflated her CV. These might seem like minor things, but can she really be trusted to govern this country, if she fails at these minor tasks?\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4095, \"fields\": {\"question\": 741, \"description\": \"Everyone on this stage agrees that something has to be done about climate change, but what Mrs Baerbock and her party want can’t be the solution! We need to involve everyone, protect livelihoods and emphasize innovation, instead of blanket bans, as Mrs. Baerbock advocates.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4096, \"fields\": {\"question\": 741, \"description\": \"I’ll attack her for her willingness to govern with the radical Left party. Moderates should be frightened by this prospect, there should be a firewall against Radicals of all stripes, and entertaining a coalition with the Left, as the Greens do repeatedly is irresponsible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4097, \"fields\": {\"question\": 741, \"description\": \"Actually, I’ve changed my mind. The mudslinging isn’t worth it - I’ll just broadly criticize Baerbock for her incompetence and then just wing it, relying on my instincts as a statesman to rise above the pack.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4098, \"fields\": {\"question\": 742, \"description\": \"I want to present myself as a candidate for pragmatic solutions to climate change. We clearly have to take action: What we need is room for market innovation and international cooperation. I’m proud of the path Germany is on in this regard - we don’t need strict bans.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4099, \"fields\": {\"question\": 742, \"description\": \"With two left-leaning politicians debating with me, I will present myself as the voice of reason. We have tax and social security plans that are actually affordable and generally promise sensible governance. The CDU is the party of the healthy centre - of competency and fiscal responsibility.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4100, \"fields\": {\"question\": 742, \"description\": \"You know me. I’m a known quantity from North Rhine-Westphalia, where I’ve governed with prudence and caution - just like Chancellor Merkel. I’m the candidate who stands for a continuation of the Merkel era - with me, Germany will stay on its successful path.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4101, \"fields\": {\"question\": 742, \"description\": \"Actually, screw this! I know they won’t hold back, so I won’t either. We have enough ammunition to show Baerbocks and Scholz’ incompetence, and I shouldn’t be afraid to use it. That way, I can sharpen my profile and show myself as the most competent candidate.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4528, \"fields\": {\"question\": 808, \"description\": \"Let's hope Mr. Dobrindt makes a good impression for the Union cause.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4529, \"fields\": {\"question\": 808, \"description\": \"Let's hope Mr. Dobrindt makes a good impression for the Union cause.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4530, \"fields\": {\"question\": 808, \"description\": \"Let's hope Mr. Dobrindt makes a good impression for the Union cause.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4531, \"fields\": {\"question\": 808, \"description\": \"Let's hope Mr. Dobrindt makes a good impression for the Union cause.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4102, \"fields\": {\"question\": 743, \"description\": \"It’s important that all wings of our party stay united and motivated to vote. Let’s campaign with Friedrich Merz to show that I’m taking people like him and his positions seriously - the CDU has a clear profile, and I’m proud to stand with him for our values!\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4103, \"fields\": {\"question\": 743, \"description\": \"Who else but Chancellor Angela Merkel could be the right person? She is a figure larger than life, a great icon who has won the last four elections, and I want to show people that I’m the one to continue her legacy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4104, \"fields\": {\"question\": 743, \"description\": \"No matter what happens, we have to make sure the right-wing demagogues do not increase their vote shares. I’m worried about the AfD taking first place in some East German states, and direct mandates could go to them: I need to campaign broadly in the New States, with local colleagues like Haselhof and Kretschmer.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4105, \"fields\": {\"question\": 743, \"description\": \"Markus Söder and I didn’t always have the warmest relationship, but there is a reason he gave me such a scare - the man has charisma. Let’s campaign with him in Bavaria and show some unity between the CDU and CSU.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4532, \"fields\": {\"question\": 809, \"description\": \"I stand by my moderate credentials, I am a proud Christian Democrat. However, we are competing with two left-wing alternatives- in order to win a strong mandate, we need to pivot leftwards, toward the center.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4533, \"fields\": {\"question\": 809, \"description\": \"The CDU is the party of the center. We have done a great job at governing over the last 16 years, and while we need to move into the future, our future is a Christian-Democratic one. I stand by my course.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4534, \"fields\": {\"question\": 809, \"description\": \"Merz has tapped into a surprisingly large voter potential in 2018: Merkel-sceptic conservatives. The chancellor has become popular with voters of the other parties - for us, some of her policies are a bit more controversial. On these issues, we definitely need to move rightwards - to provide for a real alternative to the Greens and SPD.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4535, \"fields\": {\"question\": 810, \"description\": \"I stand for what I think is right, but it’s become clear to me we need to defuse ourselves. Let’s reconcile with the more leftwards elements of the party - so that they won’t defect to the Liberals, or even our opponents.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4536, \"fields\": {\"question\": 810, \"description\": \"Yes. I stand for what I believe is right in this country, and it’s clear how we need a change in attitude in Germany to stay competitive. Our standing in the world is decreasing, and we need to work towards improving our country to be the best it can be, because we are patriots.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4537, \"fields\": {\"question\": 810, \"description\": \"Look - chancellor Merkel is a competent woman who I respect. But the fact of the matter is, her policies have tilted leftwards, both socially and economically. What our country needs in the post-Merkel era are policies more in line with conservative doctrines - the AfD’s success has shown that. If anything, we need to come back to our roots and move this country to the right.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 4538, \"fields\": {\"question\": 730, \"description\": \"While the results in Saxony-Anhalt are definitely praiseworthy, me and my surrogates should focus on Baerbock’s scandals. We’re running a national campaign - and directly dealing with our opponent might be better than lingering on state elections.\"}}]");
