    console.log(playerPolling)
    let i = 0;

    pop_vote.sort((a, b) => {
      return a.pk - b.pk;
    });

    // record the current polling data for all parties and inject some randomness
    pop_vote.forEach((entry) => {
      polling[i].push(Math.round(entry.pvp*1000*prepolling[i][campaignTrail_temp.question_number])/10);
      i++;
    });

	if (ans === 4087) {
	    campaignTrail_temp.questions_json[30]=extraQuestions[0];
	}

    if (ans === 4088) {
       campaignTrail_temp.questions_json[30]=extraQuestions[1];
    }


    if (ans === 4089) {
    campaignTrail_temp.question_number=30;
    }
    if (ans === 4003) {
       MerzTime = true;
       campaignTrail_temp.question_number=32;

    }
    if ([4023, 4025].includes(ans)) {
       SoederTime = true;
       campaignTrail_temp.question_number=32;
    }

    //coalition weight adjustments here
    if (ans === 4034) {
       coalitions.forEach(coalition => {
          if (coalition.id === 1 || coalition.id === 3 || coalition.id === 5) {
            coalition.weight -= 0.4;
          }
        });
    }

    if (ans === 4042) {
       coalitions.forEach(coalition => {
          if (coalition.id === 1 || coalition.id === 3 || coalition.id === 5) {
            coalition.weight += 0.3;
          }
        });
    }

     if ([4079, 4086].includes(ans)) {
       coalitions.forEach(coalition => {
          if (coalition.id === 1 || coalition.id === 2 || coalition.id === 10) {
            coalition.weight -= 0.2;
          }
        });
    }

     if (ans === 4087) {
       coalitions.forEach(coalition => {
          if (coalition.id === 1 || coalition.id === 3 || coalition.id === 5) {
            coalition.weight -= 0.2;
          }
        });
    }
     if (ans === 4080) {
       coalitions.forEach(coalition => {
          if ([1, 2, 3, 5, 10].includes(coalition.id)) {
            coalition.weight -= 10;
          }
          if ([7, 9].includes(coalition.id)) {
            coalition.weight += 0.2;
          }
        });
    }

   //only chart a full campaign
    if(ans > 4101){
        charts.push("line");
    }

    else
    {
        return false
    }
